                                        "attributedDescription": {
                                            "content": "لا مستحيلا .. العملِ الفنيِّ الغنائي الأضخم من نوعه عربياً.. الذي يحتفي بالأملِ والإنسانيةِ في أكثرِ صورِهما رُقيّاً \nمن إنتاج صناع الأمل وألحان الفنان العالمي ريدوان، شارك فيها أكثرمن 50 شخصية من فناني ونجوم الوطن العربي لتكون رسالة أمل ومحبة   للعالم، محتفية بقيم الطموح والإنجاز والإيجابية، مشددة على أهمية ثقافة الأمل التي تجعلنا نقهر الصعاب ونحقق المستحيل\n\nشارك كلَّ الفنانين والنجومِ ومشاهيرِ العالمِ العربي في هذا العمل ..تطوعاً.. إيماناً منهم برسالةِ الفنِّ الإنسانية فشكرا لهم\n\nإنتاج \nصناع الأمل - RedOne\nالمنتـج المنفـذ\nخـالد الشحـي\nإشراف عام \nسيعد الشحي\nإخراج \nحسين سليم\nكلمات\nمحمد المرضي\n\nlyrics:\n\nإن عشت بالأمل \nستحقق المحال\nبثبات ستصل\nأعلى من قمم الجبال\n**\nانظر للحلم البعيد\nو تسلح بالإيمان\nو إرادة من حديد\nتجد حلمك طوع البنان\n**\nفقم بادر لا تمل\nهيا لتصنع الأمل\nلنجعل أرضنا بيتا جميلا\n**\nآمن يقينا  لا مستحيل    لا مستحيل بالأمل\nآمن يقينا\nآمن يقينا  لا مستحيل   في عرف صناع الأمل\nلا مستحيل\n**\nكن كريما كالغيوم\nكن وردا للعطاء\nاسع و فرج الهموم\nلا تنتظر أبدا الثناء\n**\nمهما مرت السنون\nلا تقل فات الآوان\nنغرس فيأكلون\nهذه هي سنة الزمان\nفقم بادر لا تمل\nهيا لتصنع الأمل\nلنجعل أرضنا بيتا جميلا\n**\nآمن يقينا  لا مستحيل    لا مستحيل بالأمل\nآمن يقينا\nآمن يقينا  لا مستحيل  في عرف صناع الأمل \nلا مستحيل\n\n#صناع_الأمل\n#لا_مستحيلا\n#RedOne\n#la_moustahila",

                                        "attributedDescriptionBodyText": {
                                            "content": "لا مستحيلا .. العملِ الفنيِّ الغنائي الأضخم من نوعه عربياً.. الذي يحتفي بالأملِ والإنسانيةِ في أكثرِ صورِهما رُقيّاً \nمن إنتاج صناع الأمل وألحان الفنان العالمي ريدوان، شارك فيها أكثرمن 50 شخصية من فناني ونجوم الوطن العربي لتكون رسالة أمل ومحبة   للعالم، محتفية بقيم الطموح والإنجاز والإيجابية، مشددة على أهمية ثقافة الأمل التي تجعلنا نقهر الصعاب ونحقق المستحيل\n\nشارك كلَّ الفنانين والنجومِ ومشاهيرِ العالمِ العربي في هذا العمل ..تطوعاً.. إيماناً منهم برسالةِ الفنِّ الإنسانية فشكرا لهم\n\nإنتاج \nصناع الأمل - RedOne\nالمنتـج المنفـذ\nخـالد الشحـي\nإشراف عام \nسيعد الشحي\nإخراج \nحسين سليم\nكلمات\nمحمد المرضي\n\nlyrics:\n\nإن عشت بالأمل \nستحقق المحال\nبثبات ستصل\nأعلى من قمم الجبال\n**\nانظر للحلم البعيد\nو تسلح بالإيمان\nو إرادة من حديد\nتجد حلمك طوع البنان\n**\nفقم بادر لا تمل\nهيا لتصنع الأمل\nلنجعل أرضنا بيتا جميلا\n**\nآمن يقينا  لا مستحيل    لا مستحيل بالأمل\nآمن يقينا\nآمن يقينا  لا مستحيل   في عرف صناع الأمل\nلا مستحيل\n**\nكن كريما كالغيوم\nكن وردا للعطاء\nاسع و فرج الهموم\nلا تنتظر أبدا الثناء\n**\nمهما مرت السنون\nلا تقل فات الآوان\nنغرس فيأكلون\nهذه هي سنة الزمان\nفقم بادر لا تمل\nهيا لتصنع الأمل\nلنجعل أرضنا بيتا جميلا\n**\nآمن يقينا  لا مستحيل    لا مستحيل بالأمل\nآمن يقينا\nآمن يقينا  لا مستحيل  في عرف صناع الأمل \nلا مستحيل\n\n#صناع_الأمل\n#لا_مستحيلا\n#RedOne\n#la_moustahila",
